import useTypewriter from 'react-typewriter-hook';
import styles from './Header.module.css';

const Header = () => {
  const fullText = 'Wrocław Dom - twój przewodnik w świecie nieruchomości';
  const text = useTypewriter(fullText, { typingDelay: 10 });
  

  return (
    <header className={styles.header}>
      <img
        className={styles.headerBackground}
        src="./img/layout/wroclaw1.jpg"
        alt="Wroclaw"
      />
      <p className={`${styles.logo} ${styles.headerText}`}>
        {text}
      </p>
    </header>
  );
}

export default Header;
